$templateCache.put('auth/invitation.html','\n<div class="wrapper">\n  <div class="invitation-main">\n    <div tg-invitation="tg-invitation" class="centered invitation-container"><a href="" tg-bo-title="invitation.invited_by.full_name_display" class="avatar"><img tg-avatar="invitation.invited_by" tg-bo-alt="invitation.invited_by.full_name_display"/><span tg-bo-bind="invitation.invited_by.full_name_display" class="person-name"></span></a><span class="invitation-text">\n        <p translate="AUTH.INVITED_YOU"></p>\n        <p tg-bo-bind="invitation.project_name" class="project-name"></p></span>\n      <div class="invitation-form">\n        <form class="login-form">\n          <p translate="LOGIN_COMMON.HEADER" class="form-header"></p>\n          <fieldset>\n            <input type="text" autocorrect="off" autocapitalize="none" name="username" ng-model="dataLogin.username" data-required="true" placeholder="{{\'LOGIN_COMMON.PLACEHOLDER_AUTH_NAME\' | translate}}"/>\n          </fieldset>\n          <fieldset class="login-password">\n            <input type="password" name="password" tg-capslock="tg-capslock" ng-model="dataLogin.password" data-required="true" placeholder="{{\'LOGIN_COMMON.PLACEHOLDER_AUTH_PASSWORD\' | translate}}"/>\n            <!-- This should be hidden when focus on pass--><a href="" tg-nav="forgot-password" title="{{\'LOGIN_COMMON.TITLE_LINK_FORGOT_PASSWORD\' | translate}}" translate="LOGIN_COMMON.LINK_FORGOT_PASSWORD" class="forgot-pass"></a>\n          </fieldset>\n          <fieldset>\n            <button variant="primary" type="submit" translate="LOGIN_COMMON.ACTION_ENTER" class="btn-small full"></button>\n          </fieldset>\n          <div ng-if="authPlugins.length" class="contrib-plugins-wrapper">\n            <label translate="LOGIN_COMMON.ALT_LOGIN"></label>\n            <fieldset ng-repeat="plugin in authPlugins" ng-include="plugin.template"></fieldset>\n          </div>\n        </form>\n        <form class="register-form">\n          <p translate="REGISTER_FORM.TITLE" class="form-header"></p>\n          <fieldset>\n            <input type="text" autocorrect="off" autocapitalize="none" name="username" ng-model="dataRegister.username" data-required="true" data-maxlength="255" data-regexp="^[\\w.-]+$" placeholder="{{\'REGISTER_FORM.PLACEHOLDER_NAME\' | translate}}"/>\n          </fieldset>\n          <fieldset>\n            <input type="text" name="full_name" ng-model="dataRegister.full_name" data-required="true" data-maxlength="256" placeholder="{{\'REGISTER_FORM.PLACEHOLDER_FULL_NAME\' | translate}}"/>\n          </fieldset>\n          <fieldset>\n            <input type="email" name="email" ng-model="dataRegister.email" data-required="true" data-maxlength="255" placeholder="{{\'REGISTER_FORM.PLACEHOLDER_EMAIL\' | translate}}"/>\n          </fieldset>\n          <fieldset>\n            <input type="password" name="password" tg-capslock="tg-capslock" ng-model="dataRegister.password" data-required="true" placeholder="{{\'REGISTER_FORM.PLACEHOLDER_PASSWORD\' | translate}}"/>\n          </fieldset>\n          <tg-terms-of-service-and-privacy-policy-notice target="dataRegister.accepted_terms"></tg-terms-of-service-and-privacy-policy-notice>\n          <fieldset>\n            <button variant="primary" type="submit" ng-disabled="dataRegister.accepted_terms == false" title="{{\'REGISTER_FORM.ACTION_SIGN_UP\' | translate}}" translate="REGISTER_FORM.ACTION_SIGN_UP" class="btn-small full"></button>\n          </fieldset>\n        </form>\n      </div>\n    </div>\n  </div>\n</div>');
